import React, {Component} from 'react';
import {Row, Col, Table, Divider, Tag} from 'antd'

class Tables extends Component {
    constructor(props) {
        super(props)
        this.state = {
            columns: [{
                title: 'Name',
                dataIndex: 'name',
                key: 'name'
            }, {
                title: 'Age',
                dataIndex: 'age',
                key: 'age',
            }, {
                title: 'Address',
                dataIndex: 'address',
                key: 'address',
            }, {
                title: 'Tags',
                key: 'tags',
                dataIndex: 'tags'
            }],
            data: [{
                key: '1',
                name: 'John Brown',
                age: 32,
                address: 'New York No. 1 Lake Park',
                tags: ['nice', 'developer'],
            }, {
                key: '2',
                name: 'Jim Green',
                age: 42,
                address: 'London No. 1 Lake Park',
                tags: ['loser'],
            }, {
                key: '3',
                name: 'Joe Black',
                age: 32,
                address: 'Sidney No. 1 Lake Park',
                tags: ['cool', 'teacher'],
            }]
    }
    }

    render() {
        return (
            <div>
                <Row>
                    <Col span={24}>
                        <Table columns={this.state.columns} dataSource={this.state.data}/>
                    </Col>
                </Row>
            </div>
        );
    }
}

export default Tables;
